    <meta charset="UTF-8" />

    <title>Open House Frontend</title>
    <style>
      body {
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 0;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        height: 100vh;
        background-color: #f0f0f0;
      }
      .container {
        background-color: #fff;
        padding: 20px;
        border-radius: 8px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
      }
      .form-group {
        margin-bottom: 15px;
      }
      .form-group label {
        display: block;
        margin-bottom: 5px;
      }
      .form-group input,
      .form-group select {
        width: 100%;
        padding: 8px;
        box-sizing: border-box;
      }
      .range-container {
        display: flex;
        align-items: center;
        justify-content: space-between;
      }
      .range-value {
        width: 80px;
        text-align: center;
        padding: 8px;
        background-color: #e9ecef;
        border-radius: 4px;
      }
      .button {
        padding: 10px 20px;
        background-color: #007bff;
        color: #fff;
        border: none;
        border-radius: 4px;
        cursor: pointer;
      }
      .button:disabled {
        background-color: #ccc;
        cursor: not-allowed;
      }
      .result {
        margin-top: 20px;
        padding: 10px;
        background-color: #e9ecef;
        border-radius: 4px;
      }
    </style>
  </head>
  <body>
    <div class="container">
      <h1>Predict with SageMaker Model</h1>

      <div class="form-group">
        <label for="inputBedrooms">Enter Number of Bedrooms:</label>
        <input type="number" id="inputBedrooms" />
      </div>

      <div class="form-group">
        <label for="inputBathrooms">Enter Number of Bathrooms:</label>
        <input type="number" id="inputBathrooms" />
      </div>

      <div class="form-group">
            <label for="inputParking">Enter Number of Parking Spaces:</label>
            <input type="number" id="inputParking" />
        </div>

      <div class="form-group">
        <label for="inputArea">Enter Area (square meters):</label>
        <div class="range-container">
          <input type="range" id="inputArea" min="100" max="4000" value="0" />
          <div id="rangeValue" class="range-value">None</div>
        </div>
      </div>

      <div class="form-group">
        <label for="propertyType">Select Property Type:</label>
        <select id="propertyType" required>
          <option value="">Select a property type</option>
          <option value="Unit">Unit</option>
          <option value="House">House</option>
        </select>
      </div>

      <div class="form-group">
        <label for="Locality">Select Locality:</label>
        <select id="Locality">
          <option value="">Select a locality</option>
        </select>
      </div>

      <div class="form-group">
        <label for="Agency">Select Agency:</label>
        <select id="Agency">
          <option value="">Select an agency</option>
        </select>
      </div>

      <div class="form-group">
            <label for="Agent">Select Agent:</label>
            <select id="Agent">
                <option value="">Select an agent</option>
            </select>
        </div>

        <div class="form-group">
            <label for="Month">Select Listed Month:</label>

        </div>

        const agents = ['Natasha', 'Pietro', 'Wanda', 'Barton']

        // Function to populate a select element with options
        function populateSelect(elementId, options) {
          const selectElement = document.getElementById(elementId);
          options.forEach((optionText) => {
            const option = document.createElement("option");
            option.value = optionText.toLowerCase();
            option.textContent = optionText;
            selectElement.appendChild(option);
          });
        }

        // Populate the select elements
        populateSelect("Locality", localities);
        populateSelect("Agency", agencies);
        populateSelect('Agent', agents);

        // Update the displayed range value
        const inputArea = document.getElementById("inputArea");
        const rangeValue = document.getElementById("rangeValue");

        inputArea.addEventListener("input", () => {
          rangeValue.textContent =
            inputArea.value === "0" ? "None" : inputArea.value;
          checkFields();
        });

        // Check if at least two other fields are filled besides the property type
        function checkFields() {
          const inputBedrooms = document.getElementById("inputBedrooms").value;
          const inputBathrooms = document.getElementById("inputBathrooms").value;
          const inputParking = document.getElementById('inputParking').value;
          const inputArea = document.getElementById("inputArea").value;
          const propertyType = document.getElementById("propertyType").value;
          const locality = document.getElementById("Locality").value;
          const agency = document.getElementById("Agency").value;
          const month = document.getElementById('Month').value;
          const agent = document.getElementById('Agent').value;

          let filledCount = 0;

          // Count filled fields
          if (inputBedrooms) filledCount++;
          if (inputBathrooms) filledCount++;
          if (inputParking) filledCount++;
          if (propertyType) filledCount++;
          if (inputArea && inputArea !== "0") filledCount++;
          if (locality && locality !== "") filledCount++;
          if (agency && agency !== "") filledCount++;
          if (month && month !== "") filledCount++;
          if (agent && agent !== "") filledCount++;

          // Check if property type is selected and at least three fields are filled
          const predictButton = document.getElementById("predictButton");
          predictButton.disabled = !(propertyType && filledCount >= 3);
        }

        // Add event listeners to check the fields when they change
        document.querySelectorAll("input, select").forEach((element) => {
          element.addEventListener("input", checkFields);
        });

        // Initial check to set the button state on load
        checkFields();
      </script>

      <button class="button" id="predictButton" disabled>
        Predict Price (AUD$/wk)
      </button>
      <div id="message" class="result"></div>
    </div>
    <script>
      document
        .getElementById("predictButton")
        .addEventListener("click", async () => {
          document.getElementById("message");
          const messageDiv = document.getElementById("message");

          if (messageDiv.textContent === "Loading...") {
            // Exit if a request is already in progress
            return;
          }

          messageDiv.textContent = "Loading...";
          try {
            const response = await fetch("/api/predict", {
              method: "POST",
              headers: {
                "Content-Type": "application/json",
              },
              body: JSON.stringify({
                propertyType: document.getElementById("propertyType").value,
                bedrooms: document.getElementById("inputBedrooms").value,
                bathrooms: document.getElementById("inputBathrooms").value,
                area: document.getElementById("inputArea").value,
                locality: document.getElementById("Locality").value,
                agencyName: document.getElementById("Agency").value,
              }),
            });

            if (!response.ok) {
              if ((response.headers["Content-Type"] = "application/json")) {
                const err = await response.json();
                throw new Error(err.error);
              } else {
                throw new Error("API Request failed");
              }
            }

            const result = await response.json();

            const pred = Math.round(result.prediction);

            messageDiv.textContent = `$${pred} per week`;
          } catch (err) {
            messageDiv.textContent =
              "An error occurred. Please try again: " + err.message;
          }
        });
    </script>
